import React from "react";
import ListArray from "./ListArray";

const List = (props) => {
    return (
        <div>
            {props.items.map
            (item => <ListArray
            text = {item.text} 
            id = {item.id}
            >
                {item.text}
                </ListArray>)}
        </div>
    )
}

export default List;
